describe("large-viewstate", function() {

  var log

  function onComplete(reports) {
    log = []
    reports.forEach(function(report) {
      log.push(report)
    })
  }

  it("warns when viewstate is more than 50 KB", function() {
     var html = parseHTML(''
          + '<input type="hidden" name="__VIEWSTATEFIELDCOUNT" id="__VIEWSTATEFIELDCOUNT" value="26">'
          + '<input type="hidden" name="__VIEWSTATE" id="__VIEWSTATE" value="">'
          + '<input type="hidden" name="__VIEWSTATE1" id="__VIEWSTATE1" value="">'
          + '<input type="hidden" name="__VIEWSTATE2" id="__VIEWSTATE2" value="">'
          + '<input type="hidden" name="__VIEWSTATE3" id="__VIEWSTATE3" value="">'
          + '<input type="hidden" name="__VIEWSTATE4" id="__VIEWSTATE4" value="">'
          + '<input type="hidden" name="__VIEWSTATE5" id="__VIEWSTATE5" value="">'
          + '<input type="hidden" name="__VIEWSTATE6" id="__VIEWSTATE6" value="">'
          + '<input type="hidden" name="__VIEWSTATE7" id="__VIEWSTATE7" value="">'
          + '<input type="hidden" name="__VIEWSTATE8" id="__VIEWSTATE8" value="">'
          + '<input type="hidden" name="__VIEWSTATE9" id="__VIEWSTATE9" value="">'
          + '<input type="hidden" name="__VIEWSTATE10" id="__VIEWSTATE10" value="">'
          + '<input type="hidden" name="__VIEWSTATE11" id="__VIEWSTATE11" value="">'
          + '<input type="hidden" name="__VIEWSTATE12" id="__VIEWSTATE12" value="">'
          + '<input type="hidden" name="__VIEWSTATE13" id="__VIEWSTATE13" value="">'
          + '<input type="hidden" name="__VIEWSTATE14" id="__VIEWSTATE14" value="">'
          + '<input type="hidden" name="__VIEWSTATE15" id="__VIEWSTATE15" value="">'
          + '<input type="hidden" name="__VIEWSTATE16" id="__VIEWSTATE16" value="">'
          + '<input type="hidden" name="__VIEWSTATE17" id="__VIEWSTATE17" value="">'
          + '<input type="hidden" name="__VIEWSTATE18" id="__VIEWSTATE18" value="">'
          + '<input type="hidden" name="__VIEWSTATE19" id="__VIEWSTATE19" value="">'
          + '<input type="hidden" name="__VIEWSTATE20" id="__VIEWSTATE20" value="">'
          + '<input type="hidden" name="__VIEWSTATE21" id="__VIEWSTATE21" value="">'
          + '<input type="hidden" name="__VIEWSTATE22" id="__VIEWSTATE22" value="">'
          + '<input type="hidden" name="__VIEWSTATE23" id="__VIEWSTATE23" value="">'
          + '<input type="hidden" name="__VIEWSTATE24" id="__VIEWSTATE24" value="">'
          + '<input type="hidden" name="__VIEWSTATE25" id="__VIEWSTATE25" value="">'
        )

    HTMLInspector.inspect({
      useRules: ["large-viewstate"],
      domRoot: html,
      onComplete: onComplete
    })

    expect(log.length).to.equal(1)
    expect(log[0].message).to.equal("52 KB is being used in 26 chunk(s) of View State.")
    expect(log[0].context).to.equal("Disable View States where not needed for better performace.")
  })

    
  it("doesn't warn when viewstate is not more than 50 KB", function() {
     var html = parseHTML('<input type="hidden" name="__VIEWSTATE" id="__VIEWSTATE" value="/wEPDwUKLTk2Njk0Mzk3N2RkYxEqbumv15Dmq6hqC6GDPtikSRQ=" />')

    HTMLInspector.inspect({
      useRules: ["large-viewstate"],
      domRoot: html,
      onComplete: onComplete
    })
  expect(log.length).to.equal(0)
  })

  it("allows for customization by altering the config object", function() {

    var html = parseHTML(''
          + '<input type="hidden" name="__VIEWSTATEFIELDCOUNT" id="__VIEWSTATEFIELDCOUNT" value="11">'
          + '<input type="hidden" name="__VIEWSTATE" id="__VIEWSTATE" value="">'
          + '<input type="hidden" name="__VIEWSTATE1" id="__VIEWSTATE1" value="">'
          + '<input type="hidden" name="__VIEWSTATE2" id="__VIEWSTATE2" value="">'
          + '<input type="hidden" name="__VIEWSTATE3" id="__VIEWSTATE3" value="">'
          + '<input type="hidden" name="__VIEWSTATE4" id="__VIEWSTATE4" value="">'
          + '<input type="hidden" name="__VIEWSTATE5" id="__VIEWSTATE5" value="">'
          + '<input type="hidden" name="__VIEWSTATE6" id="__VIEWSTATE6" value="">'
          + '<input type="hidden" name="__VIEWSTATE7" id="__VIEWSTATE7" value="">'
          + '<input type="hidden" name="__VIEWSTATE8" id="__VIEWSTATE8" value="">'
          + '<input type="hidden" name="__VIEWSTATE9" id="__VIEWSTATE9" value="">'
          + '<input type="hidden" name="__VIEWSTATE10" id="__VIEWSTATE10" value="">'
        )

    // warn if viewstate takes more than 20 KB
    HTMLInspector.rules.extend("large-viewstate", {
      sizeInKB: 20
    })
    
    HTMLInspector.inspect({
      useRules: ["large-viewstate"],
      domRoot: html,
      onComplete: onComplete
    })

    expect(log.length).to.equal(1)
    expect(log[0].message).to.equal("22 KB is being used in 11 chunk(s) of View State.")
    expect(log[0].context).to.equal("Disable View States where not needed for better performace.")
    
  })
})